import * as React from 'react';
import { Grid, Typography } from '@mui/material';
import aplogo from '../data/aplogo.png';
import { Link } from 'react-router-dom';
import "./layout.css";
import { Container } from '@mui/system';

export default function SignUpIndexV2(){
    return (
    <Container component="main" maxWidth>
        <Grid container sx={{borderBottom: 1, borderBottomColor: 'grey.500'}}>
            <Grid item xs>
                <img class="image" src={aplogo} alt=' ' />
            </Grid>

            <Grid item>
                <Link to="/">로그인</Link>
                 <sapn>  |  </sapn>
                <Link to="/r2">회원가입 </Link>
            </Grid>
        </Grid>

        <Grid
        id="아이콘 및 큰 제목"
        container
        sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: "center",}}
        >
            <img src={aplogo} alt="  "/>
        <Typography variant="h5" component="h5">회원가입</Typography>
        </Grid>



    </Container>
    );
}
